INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (52275, 3433, 'Fluoxetine', 'Inappropriate ADH Syndrome', 'The use of selective serotonin reuptake inhibitors (SSRIs) has rarely been associated with hyponatremia, sometimes secondary to development of the syndrome of inappropriate secretion of antidiuretic hormone (SIADH).  These events have generally been reversible following discontinuation of SSRI therapy and/or medical intervention.  SSRI-related hyponatremia may be more common in elderly female patients and those who are volume-depleted or receiving concomitant diuretic therapy.  Caution may be warranted when SSRI therapy is administered in these patients and patients with preexisting hyponatremia or SIADH.  Serum electrolytes, especially sodium as well as BUN and plasma creatinine, should be monitored regularly.', '2', '', 'DDInter', 0);
