INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (52292, 25454, 'Fluoxetine', 'Inappropriate ADH Syndrome', 'The use of selective serotonin reuptake inhibitors (SSRIs) has rarely been associated with hyponatremia, sometimes secondary to development of the syndrome of inappropriate secretion of antidiuretic hormone (SIADH).  These events have generally been reversible following discontinuation of SSRI therapy and/or medical intervention.  SSRI-related hyponatremia may be more common in elderly female patients and those who are volume-depleted or receiving concomitant diuretic therapy.  Caution may be warranted when SSRI therapy is administered in these patients and patients with preexisting hyponatremia or SIADH.  Serum electrolytes, especially sodium as well as BUN and plasma creatinine, should be monitored regularly.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (52293, 3433, 'Fluoxetine', 'Kidney Diseases', 'Fluoxetine is primarily metabolized by the liver.  All but one metabolites are inactive, and they are excreted by the kidney.  The clearance of norfluoxetine, the active metabolite, is not dependent on renal function.  Dosage adjustments are generally not deemed necessary in patients with impaired renal function, although the clinical significance of possible metabolite accumulation is unknown.  Caution may be warranted when fluoxetine therapy is administered in patients with severe renal dysfunction.', '1', '', 'DDInter', 0);
